import React from "react";
import {
  Container,
  Row,
  Col,
  Form,
  FormGroup,
  FormLabel,
  FormControl,
  Button,
  NavLink,
} from "react-bootstrap";
import Select from "react-dropdown-select";
import "../assests/App.css";
const Menu = () => {
  const options = [
    {
      value: 1,
      label: "Leanne Graham",
    },
    {
      value: 2,
      label: "Ervin Howell",
    },
  ];
  return (
    <div className="menu">
      <div className="container">
        <h1>Select the Farm</h1>
        <Form>
          <Select className="select" options={options} placeholder="State" />

          <Select className="select" options={options} placeholder="District" />

          <Select className="select" options={options} placeholder="Hobli" />

          <Select className="select" options={options} placeholder="Village" />

          <FormControl
            className="surveyno"
            type="number"
            placeholder="Survey no"
          />

          <Button type="Submit">Submit</Button>
        </Form>
        <div className="bbox">
          <h4>API:</h4>
          <a href="gmail.com">Link</a>
        </div>
      </div>
    </div>
  );
};

export default Menu;
